export default function Card({ animeData, onChoice, onBack }) {
  // console.log(animeData);
  // console.log(animeData?.mal_id);

  return (
    <div className="card-content glass" onClick={() => onChoice(animeData)}>
      <div className="card-img-box">
        <img
          className="card-img"
          src={animeData?.images?.webp?.large_image_url}
          alt="k"
        ></img>
      </div>
      <h2 className="card-title">{animeData?.title}</h2>
    </div>
  );
}
